    if (!tgui_glad_gl_find_extensions_gl(version)) return 0;
    tgui_glad_gl_load_GL_ARB_ES2_compatibility(load, userptr);
    tgui_glad_gl_load_GL_ARB_blend_func_extended(load, userptr);
    tgui_glad_gl_load_GL_ARB_copy_buffer(load, userptr);
    tgui_glad_gl_load_GL_ARB_draw_elements_base_vertex(load, userptr);
