    tgui_glad_gl_load_GL_ARB_separate_shader_objects(load, userptr);
    tgui_glad_gl_load_GL_ARB_shader_subroutine(load, userptr);
    tgui_glad_gl_load_GL_ARB_sync(load, userptr);
